def solution(stdin: str) -> str:
    stock = {}
    result = 0
    for line in stdin.split('\n'):
        if len(line) == 0:
            break
        parts = line.split()
        if len(parts) == 4 and parts[0] == 'buy':
            stock[int(parts[1])] = {'stock': int(parts[1]), 'cost': float(parts[2]), 'proceeds': 0}
        elif len(parts) == 4 and parts[0] =='sell':
            stock[int(parts[1])]['proceeds'] += float(parts[2])
        elif len(parts) == 4 and parts[0] =='split':
            stock[int(parts[1])]['stock'] *= int(parts[2])
        elif len(parts) == 4 and parts[0] =='merge':
            stock[int(parts[1])]['stock'] = int(parts[2]) * stock[int(parts[1])]['stock']
        elif len(parts) == 4 and parts[0] == 'die':
            result += stock[int(parts[1])]['proceeds']
            del stock[int(parts[1])]
    for k in stock.keys():
        result += k * stock[k]['proceeds']
    return str(result)


