def solution(stdin: str) -> str:
    grid = stdin.split()
    rows = len(grid)
    columns = len(grid[0])

    visited = set()
    count = 0

    def island_traversal(row: int, column: int, color: str) -> None:
        if row < 0 or column < 0 or row >= rows or column >= columns or (row, column) in visited:
            return
        visited.add((row, column))
        if grid[row][column] == color:
            island_traversal(row - 1, column, color)
            island_traversal(row + 1, column, color)
            island_traversal(row, column - 1, color)
            island_traversal(row, column + 1, color)

    for row in range(rows):
        for column in range(columns):
            if grid[row][column] == 'L' and (row, column) not in visited:
                count += 1
                island_traversal(row, column, 'L')

    return count

